import React from 'react';

export default class Header extends React.Component {
    render() {
        return(
            <div>
              <a href="#"><h1>Star DB</h1></a>
              <ul className="list-group-flush">
                  <li>People</li>
                  <li>Planets</li>
                  <li>Ships</li>
                   </ul>
            </div>
        )
    }
}
